import React from 'react';

function codeBurger (props) {
  return (
    <div>
      <h1>{props.titulo}</h1>
      <img src = {props.burger.png} alt = {'Imagem do burger'}></img>
    </div>
  );
};
function buttonPedidos (label, onClick) {
  return (
    <button type="submit" onClick={ onClick }>
      { label } 
    </button>
  );
};

export default (buttonPedidos, codeBurger);
